import React from "react";
import PurchaseList from "../Receipt/PurchaseList";
import IngredientList from "../Recipe/IngredientList";
import "./Dashboard.css"

const Layout = () => {
  return (
      <div class="flex-container">
        <div class="flex-item">
          <IngredientList />
        </div>
        <div class="grid-item">
          <PurchaseList />
        </div>
      </div>
  );
};

export default Layout;
